import Footer from "./components/Footer";
import Works from "./components/Works";
import FAQs from "./components/FAQs";
import Service from "./components/Service";
import Navbar from "./components/Navbar";

const App = () => {
  return (
    <div className="App">
      <div className="contaienr">

      </div>
      <Navbar />
      <Landing />
      <Skills />
      <Service />
      <Process />
      <WebSuccess />
      <Works />
      <FAQs />
      <Footer />
    </div>
  );
};

export default App;
